import Navbar from 'react-bootstrap/Navbar';

import logo from '../logo.png';

const navigation = () => {
    return(
            <Navbar>
                <img 
                    alt ="logo" 
                    src={logo}
                    width="40" 
                    height="40"
                    className="d-inline-block align-top mx-3"
                />
                <NavbarBrand href="#">DApp ICO Crowdsale</NavbarBrand>
            </Navbar>
    )
}

export default navigation;
